CREATE TABLE IF NOT EXISTS Faculty (
  `ID` int(6) NOT NULL AUTO_INCREMENT unique,
  `type` varchar(8) NOT NULL,
  `email` varchar(255) NOT NULL unique,
  `password` varchar(255) NOT NULL,
  `first_Name` varchar(255) NOT NULL,
  `middle_Initial` varchar(1) DEFAULT NULL,
  `last_Name` varchar(255) NOT NULL,
  `phone_Number` varchar(10) DEFAULT NULL,
  `DOB` varchar(10) DEFAULT NULL,
  `employment_Status` varchar(10) DEFAULT NULL,
  `department_Name` varchar(50) DEFAULT NULL,
  `office_Hours` varchar(50) DEFAULT NULL,
  `hidden` boolean default False,
  PRIMARY KEY (`ID`),
  FOREIGN KEY (`ID`) REFERENCES `User` (`ID`),
  FOREIGN KEY (`type`) REFERENCES `User` (`type`),
  FOREIGN KEY (`email`) REFERENCES `User` (`email`),
  FOREIGN KEY (`password`) REFERENCES `User` (`password`),
  FOREIGN KEY (`first_Name`) REFERENCES `User` (`first_Name`),
  FOREIGN KEY (`middle_Initial`) REFERENCES `User` (`middle_Initial`),
  FOREIGN KEY (`last_Name`) REFERENCES `User` (`last_Name`),
  FOREIGN KEY (`phone_Number`) REFERENCES `User` (`phone_Number`),
  FOREIGN KEY (`DOB`) REFERENCES `User` (`DOB`),
  FOREIGN KEY (`department_Name`) REFERENCES `Department` (`department_Name`)
) ;

ALTER TABLE Faculty AUTO_INCREMENT=503004;

