    FOREIGN KEY (`timeslot_ID`) REFERENCES `TimeSlot` (`timeslot_ID`),
    FOREIGN KEY (`semester_ID`) REFERENCES `SemesterYear` (`semester_ID`),
    FOREIGN KEY (`room_ID`) REFERENCES `Room` (`room_ID`)
);

