CREATE TABLE IF NOT EXISTS MasterSchedule (
    `CRN` int(6) NOT NULL,
    `course_ID` int(6) NOT NULL,
    `section_Number` varchar(10) NOT NULL,
    `course_Name` varchar(50) NOT NULL,
    `department_Name` varchar(50) NOT NULL,
    `semester_ID` int(6) NOT NULL,
    PRIMARY KEY (`CRN`),
    FOREIGN KEY (`CRN`) REFERENCES `Section` (`CRN`),
    FOREIGN KEY (`course_ID`) REFERENCES `Section` (`course_ID`),
    FOREIGN KEY (`section_Number`) REFERENCES `Section` (`section_Number`),
    FOREIGN KEY (`course_Name`) REFERENCES `Section` (`course_Name`),
    FOREIGN KEY (`department_Name`) REFERENCES `Department` (`department_Name`),
    FOREIGN KEY (`semester_ID`) REFERENCES `Section` (`semester_ID`)
);

INSERT INTO MasterSchedule(`CRN`,`course_ID`,`section_Number`,`course_Name`,`department_Name`,`semester_ID`)
SELECT `CRN`, `course_ID`, `section_Number`, `course_Name`, `department_Name`, `semester_ID` FROM Section;


CREATE TABLE IF NOT EXISTS Enrollment (
    `CRN` int(6) NOT NULL,
    `student_ID` int(6) NOT NULL,
    `midterm_Grade` varchar(5) DEFAULT NULL,
    `final_Grade` varchar(5) DEFAULT NULL,
    `semester_ID` int(6) NOT NULL,
    FOREIGN KEY (`CRN`) REFERENCES `Section` (`CRN`),
    FOREIGN KEY (`student_ID`) REFERENCES `Student` (`ID`),
    FOREIGN KEY (`semester_ID`) REFERENCES `Section` (`semester_ID`)
);

